import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Card, 
  CardContent, 
  Paper,
  Button,
  LinearProgress,
  IconButton,
  Tooltip
} from '@mui/material';
import {
  People as PeopleIcon,
  Home as HomeIcon,
  Message as MessageIcon,
  AttachMoney as MoneyIcon,
  Refresh as RefreshIcon,
  ArrowForward as ArrowForwardIcon
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const StatCard = ({ title, value, icon: Icon, color, trend, trendText }) => (
  <Card elevation={2}>
    <CardContent>
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <Box>
          <Typography color="textSecondary" variant="subtitle2" gutterBottom>
            {title}
          </Typography>
          <Typography variant="h4" component="div">
            {value}
          </Typography>
          {trend && (
            <Box display="flex" alignItems="center" mt={1}>
              <Typography 
                variant="caption" 
                color={trend > 0 ? 'success.main' : 'error.main'}
                display="flex"
                alignItems="center"
              >
                {trend > 0 ? '↑' : '↓'} {Math.abs(trend)}%
                <Box component="span" ml={0.5} color="text.secondary">
                  {trendText}
                </Box>
              </Typography>
            </Box>
          )}
        </Box>
        <Box
          sx={{
            backgroundColor: `${color}.light`,
            color: `${color}.dark`,
            borderRadius: '12px',
            height: '48px',
            width: '48px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}
        >
          <Icon fontSize="medium" />
        </Box>
      </Box>
    </CardContent>
  </Card>
);

const AdminOverview = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalProperties: 0,
    totalMessages: 0,
    totalRevenue: 0,
    userGrowth: 0,
    propertyGrowth: 0,
    revenueGrowth: 0,
    loading: true
  });
  
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const fetchStats = async () => {
    try {
      setLoading(true);
      setError(null);
      
      // Fetch user count from the API
      const usersResponse = await api.users.getAll();
      const totalUsers = usersResponse.data.length;
      
      // Calculate user growth (this is a placeholder - you might want to implement actual growth calculation)
      const userGrowth = 12.5; // Replace with actual growth calculation
      
      setStats(prev => ({
        ...prev,
        totalUsers,
        userGrowth,
        loading: false
      }));
      
    } catch (err) {
      console.error('Error fetching stats:', err);
      setError('Failed to load statistics. Please try again.');
      setStats(prev => ({
        ...prev,
        loading: false
      }));
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchStats();
    
    // Set up polling to refresh stats every 5 minutes
    const intervalId = setInterval(fetchStats, 5 * 60 * 1000);
    
    // Clean up interval on component unmount
    return () => clearInterval(intervalId);
  }, []);

  if (loading && !stats.totalUsers) {
    return (
      <Box p={3}>
        <LinearProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box p={3}>
        <Typography color="error">{error}</Typography>
        <Button 
          variant="contained" 
          color="primary" 
          onClick={fetchStats}
          startIcon={<RefreshIcon />}
          sx={{ mt: 2 }}
        >
          Retry
        </Button>
      </Box>
    );
  }

  return (
    <Box p={3}>
      <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
        <Typography variant="h4" component="h1">
          Dashboard Overview
        </Typography>
        <Box>
          <Tooltip title="Refresh stats">
            <IconButton 
              onClick={fetchStats}
              disabled={loading}
              color="primary"
            >
              <RefreshIcon />
            </IconButton>
          </Tooltip>
        </Box>
      </Box>

      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Total Users"
            value={stats.totalUsers.toLocaleString()}
            icon={PeopleIcon}
            color="primary"
            trend={stats.userGrowth}
            trendText="from last month"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Properties" 
            value={stats.totalProperties.toLocaleString()} 
            icon={HomeIcon} 
            color="secondary"
            trend={stats.propertyGrowth}
            trendText="vs last month"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Messages" 
            value={stats.totalMessages.toLocaleString()} 
            icon={MessageIcon} 
            color="info"
            trend={-3.1}
            trendText="vs last week"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard 
            title="Total Revenue" 
            value={`$${stats.totalRevenue.toLocaleString()}`} 
            icon={MoneyIcon} 
            color="success"
            trend={stats.revenueGrowth}
            trendText="vs last month"
          />
        </Grid>
      </Grid>

      <Grid container spacing={3}>
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 3, height: '100%' }}>
            <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
              <Typography variant="h6">Quick Stats</Typography>
              <Button 
                size="small" 
                endIcon={<ArrowForwardIcon />}
                onClick={() => navigate('/dashboard/admin/analytics')}
              >
                View Analytics
              </Button>
            </Box>
            <Box height={300} display="flex" alignItems="center" justifyContent="center">
              <Typography color="text.secondary">
                Analytics chart will be displayed here
              </Typography>
            </Box>
          </Paper>
        </Grid>
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 3, height: '100%' }}>
            <Typography variant="h6" gutterBottom>System Status</Typography>
            <Box mb={3}>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2">Server Load</Typography>
                <Typography variant="body2">24%</Typography>
              </Box>
              <LinearProgress variant="determinate" value={24} color="primary" />
            </Box>
            <Box mb={3}>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2">Database</Typography>
                <Typography variant="body2" color="success.main">Connected</Typography>
              </Box>
              <LinearProgress variant="determinate" value={100} color="success" />
            </Box>
            <Box>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2">Storage</Typography>
                <Typography variant="body2">65% used</Typography>
              </Box>
              <LinearProgress variant="determinate" value={65} color="warning" />
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default AdminOverview;
